var arrLeague = [36,'英格兰超级联赛','英格蘭超級聯賽','English Premier League','2019-2020','#FF3333','league_match/images/20160816164328.png',38,36,'英超','英超','ENG PR','　　英格兰足球超级联赛共由20支球队组成，采取双循环赛制（每支球队分别以主、客场身份和其他球队交锋两次）。单场比赛积分计算方法是胜者得3分、负者得0分、平局则双方各得1分，赛季末按累计积分高低排名。积分相同的球队由净胜球和总进球数等来决定排名，如果涉及联赛冠军、升降级名额的球队通过以上条件仍不分上下，再看两队之间的交锋战绩及相互对战客场进球，仍相同则需要进行附加赛。<br/>　　联赛前四名直接参加下赛季冠军联赛小组赛，第五名参加下赛季欧霸杯（英格兰足总杯冠军可参加欧霸杯，如果足总杯冠军已经取得欧战资格，则其名额给足总杯亚军；英格兰联赛杯冠军可参加欧霸杯第三轮资格赛，如果联赛杯冠军已经取得欧战资格，则其名额让给联赛未获欧战资格中排名靠前的球队）若欧冠、欧联冠军都是英超球队，且两支球队都未通过联赛获得欧冠资格，则第四名参加欧联杯。本赛季联赛排名最后三位的球队下赛季将降到英冠。'];
